import React from "react";

function Logo(props){
    return(
        <div className ="logo">
        <a><img style={{width: props.lsize}} src="https://cdn-icons-png.flaticon.com/512/992/992615.png" alt="logo" /></a>
        <a style={{fontSizeAdjust: props.fsize}} style={{display: props.show==="true"?"unset":"none"}} className="nav-item" href= {props.href}>SeekCruiter</a>
    </div>
    )
}
export default Logo
